import React, { useEffect, useState } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { Row, Col, Button } from 'reactstrap';
import UserTable from './Table';
import './style.scss';
import { usersTableHead } from '../../common';
import { getUsersLists } from '../../store/reducers/users/action';

const UserComponent = ({props}) => {
    const dispatch = useDispatch();
    const userState = useSelector(state => {return state.users.userList});
    const [usersList, setusersList] = useState({
        columns: [...usersTableHead],
        rows: []
    });

    useEffect(() => {
        dispatch(getUsersLists())
    }, []);

    useEffect(() => {
        if (userState.list && userState.list.length > 0) {
            setusersList({
                columns: usersList.columns,
                rows: [...userState.list]
            })
        }
    }, [userState])

    return (
        <div>
            <Row className="d-flex">
                <Col>
                    <p className="page-head">Users &nbsp; Page</p>                    
                </Col>
                <Col>
                    <Button> 
                        Add User
                    </Button>
                </Col>
            </Row>
            <Row>
                <Col>
                    <UserTable tableRows={usersList} tableHead={usersTableHead} />
                </Col>
            </Row>
        </div>
    )
}

export default UserComponent
